import React from 'react'
import { Modal, Button, Form, Input, Card } from 'antd'

class ModalSearch extends React.Component {

    constructor() {
        super()
        this.state = {
            ModalVisibel: false
        }
    }

    onSearch = () => {
        this.setState({ ModalVisibel: true })
    }

    render() {
        return (
            <div>
                <Button
                    onClick={this.onSearch}
                >
                    {'ค้นหาข้อมูล'}
                </Button>
                <Modal
                    visible={this.state.ModalVisibel}
                    onCancel={() => this.setState({ ModalVisibel: false })}
                    footer={null}
                >
                    <Card>
                        <Form>
                            <Form.Item>
                                <Input />
                            </Form.Item>
                            <Form.Item>
                                <Input />
                            </Form.Item>
                            <Form.Item>
                                <Input />
                            </Form.Item>
                            <Form.Item>
                                <Button>ค้นหา</Button>
                            </Form.Item>
                        </Form>
                    </Card>
                  
                </Modal>
            </div>
        )
    }
}

export default ModalSearch
